import React from 'react';
import { RefreshControl, Pressable, StatusBar, SafeAreaView, ScrollView, StyleSheet, Text, TextInput, View, Image  } from 'react-native';

class Gare extends React.Component  {
  constructor(props) {
		super(props);
    this.state = {
        query : ''
    }
    this.onChangeText = this.onChangeText.bind(this)
	}

  onChangeText(e){
    this.setState({
      query: e
    })
  }
	render(){

		return (
      <SafeAreaView  style={styles.container}>          
          <View>  
            <View style={styles.form}>
              <TextInput
                style={styles.input}
                onChangeText={this.onChangeText}
                value={this.state.query}

                placeholder = 'Rechercher une gare'
                placeholderTextColor = '#ccc'
              />
            </View> 
            <Text>{this.state.query}</Text>   

          </View>
      </SafeAreaView >
    );
  }
}

export default Gare;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#202020',
  },
  form: {
    borderColor: '#0064aab7',
    borderWidth: 2,
    borderRadius: 10,
    marginTop: 15,
    marginLeft: 15,
    padding: 5,
    color: '#fff',
    fontSize: 20,
    width: '92%',
  },
  input: {
    color: '#fff',
  }
});
